import React from 'react';
import Ace from 'react-ace';
import brace from 'brace';


class CodeView extends React.Component
{
    render(){
        return(
            <Ace
                theme="solarized_dark"
                fontSize="14"
            />
        );
    }

}

export default CodeView;
